import React from 'react';
import PropTypes from "prop-types";

const foodILike = [
  {
    id :1,
    name : "kimchi",
    image : "",
    rating: 4.7    
  },
  {
    id :2,
    name : "ramen",
    image : "https://www.google.com/imgres?imgurl=http%3A%2F%2Fwww.olivenote.co.kr%2Fnews%2Fphoto%2F201705%2F129_115_4133.jpg&imgrefurl=http%3A%2F%2Fwww.olivenote.co.kr%2Fnews%2FarticleView.html%3Fidxno%3D129&docid=iU_gYQoTjYzvsM&tbnid=jVWN6AZovrS5YM%3A&vet=10ahUKEwiS2d-jnLfmAhUOrZQKHWqfA3AQMwiEASgDMAM..i&w=1232&h=1230&bih=950&biw=1148&q=%EC%9D%8C%EC%8B%9D%20%EC%9D%B4%EB%AF%B8%EC%A7%80&ved=0ahUKEwiS2d-jnLfmAhUOrZQKHWqfA3AQMwiEASgDMAM&iact=mrc&uact=8"    ,
    rating: 2.0
  },
  {
    id :3,
    name : "samgusal",
    image : "https://www.google.com/url?sa=i&source=images&cd=&ved=2ahUKEwieoaKknLfmAhWhGKYKHV_HC-kQjRx6BAgBEAQ&url=https%3A%2F%2Fm.gettyimagesbank.com%2Fview%2F%25EC%259D%258C%25EC%258B%259D-%25EC%259D%25BC%25EB%259F%25AC%25EC%258A%25A4%25ED%258A%25B8%2Fa8958297&psig=AOvVaw18QCVM5Jy_jSUw5m0VO4OO&ust=1576484428124718",
    rating: 3.2
  }
];

function Food({name, picture}) {
return <div>
    <h2>I like {name}</h2>
      <img src={picture} alt={name} />
    </div>;
}

function RenderFood(dish) {
  console.log(dish);
  return <Food key={dish.id} name={dish.name} picture={dish.image} rating={dish.rating} />;
}

function App() {
  return (
    <div className="App">
    {foodILike.map(RenderFood)}
    </div>
  );
}

export default App;
